import React from 'react';
import './styles.css';

function Header({ onToggle }) {
  return (
    <div className="header">
      <button onClick={() => onToggle(true)}>Login</button>
      <button onClick={() => onToggle(false)}>Signup</button>
    </div>
  );
}

export default Header;
